import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom"; // Import useNavigate for navigation
import APIHandler from "../utils/APIHandler";

const MedicineManage = () => {
    const [medicines, setMedicines] = useState([]);
    const [formData, setFormData] = useState({
        name: "",
        medical_typ: "",
        buy_price: "",
        sell_price: "",
        c_gst: "",
        s_gst: "",
        batch_no: "",
        shelf_no: "",
        expire_date: "",
        mfg_date: "",
        company_id: "",
        description: "",
        in_stock_total: "",
        qty_in_strip: "",
    });
    const apiHandler = new APIHandler();
    const navigate = useNavigate(); // Initialize useNavigate

    const fetchMedicines = async () => {
        try {
            const response = await apiHandler.getMedicines(); // Method to get all medicines
            if (response.error) {
                alert(response.message);
            } else {
                setMedicines(response.data);
            }
        } catch (error) {
            console.error("Error fetching medicines:", error);
        }
    };

    useEffect(() => {
        fetchMedicines();
    }, []);

    const handleInputChange = (event) => {
        const { name, value } = event.target;
        setFormData((prevFormData) => ({
            ...prevFormData,
            [name]: value,
        }));
    };

    const handleFormSubmit = async (event) => {
        event.preventDefault();
        const newMedicine = { ...formData };

        try {
            // Call your API to add medicine
            const response = await apiHandler.addMedicine(newMedicine); // Assuming you have this method
            if (response.error) {
                alert(response.message);
            } else {
                // Clear form data
                setFormData({
                    name: "",
                    medical_typ: "",
                    buy_price: "",
                    sell_price: "",
                    c_gst: "",
                    s_gst: "",
                    batch_no: "",
                    shelf_no: "",
                    expire_date: "",
                    mfg_date: "",
                    company_id: "",
                    description: "",
                    in_stock_total: "",
                    qty_in_strip: "",
                });
                // Fetch updated medicine list
                fetchMedicines();
                // Navigate to MedicineManage
                navigate("/MedicineManage");
            }
        } catch (error) {
            console.error("Error adding medicine:", error);
        }
    };

    return (
        <div style={{ padding: "20px" }}>
            <h2>Medicine List</h2>

            {/* Form to add new medicine */}
            <form onSubmit={handleFormSubmit} style={{ marginBottom: "20px" }}>
                <h3>Add New Medicine</h3>
                <input
                    type="text"
                    name="name"
                    placeholder="Name"
                    value={formData.name}
                    onChange={handleInputChange}
                    required
                />
                <input
                    type="text"
                    name="medical_typ"
                    placeholder="Type"
                    value={formData.medical_typ}
                    onChange={handleInputChange}
                    required
                />
                <input
                    type="number"
                    name="buy_price"
                    placeholder="Buy Price"
                    value={formData.buy_price}
                    onChange={handleInputChange}
                    required
                />
                <input
                    type="number"
                    name="sell_price"
                    placeholder="Sell Price"
                    value={formData.sell_price}
                    onChange={handleInputChange}
                    required
                />
                <input
                    type="number"
                    name="in_stock_total"
                    placeholder="In Stock"
                    value={formData.in_stock_total}
                    onChange={handleInputChange}
                    required
                />
                {/* Add other fields as necessary */}
                <button type="submit">Add Medicine</button>
            </form>

            <table style={{ width: "100%", borderCollapse: "collapse" }}>
                <thead>
                    <tr>
                        <th style={{ border: "1px solid #ddd", padding: "8px" }}>Name</th>
                        <th style={{ border: "1px solid #ddd", padding: "8px" }}>Type</th>
                        <th style={{ border: "1px solid #ddd", padding: "8px" }}>Buy Price</th>
                        <th style={{ border: "1px solid #ddd", padding: "8px" }}>Sell Price</th>
                        <th style={{ border: "1px solid #ddd", padding: "8px" }}>In Stock</th>
                    </tr>
                </thead>
                <tbody>
                    {medicines.map((medicine) => (
                        <tr key={medicine.id}>
                            <td style={{ border: "1px solid #ddd", padding: "8px" }}>{medicine.name}</td>
                            <td style={{ border: "1px solid #ddd", padding: "8px" }}>{medicine.medical_typ}</td>
                            <td style={{ border: "1px solid #ddd", padding: "8px" }}>{medicine.buy_price}</td>
                            <td style={{ border: "1px solid #ddd", padding: "8px" }}>{medicine.sell_price}</td>
                            <td style={{ border: "1px solid #ddd", padding: "8px" }}>{medicine.in_stock_total}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default MedicineManage;
